import {BrowserRouter, Route, Switch} from 'react-router-dom';

// General Containers
import DateTime from './components/DateTime'
import WeatherInfo from './components/WeatherInfo'

// User Specific Containers

// User kr
import BuildingInfo_u_kr from './components/u_kr/BuildingInfo_u_kr'
import EmissionInfo_u_kr from './components/u_kr/EmissionInfo_u_kr'
import GraphInfoContainer_u_kr from './components/u_kr/GraphInfoContainer_u_kr'

// import BuildingInfo_u_kr from './components/BuildingInfo_u_kr'
// import EmissionInfo_u_kr from './components/EmissionInfo_u_kr'
// import GraphInfoContainer_u_kr from './components/GraphInfoContainer_u_kr'


function App() {
    return (
        <div className="container">
            <div>
                <BrowserRouter>
                    <Switch>
                        <Route path="/kr">
                            <BuildingInfo_u_kr/>
                        </Route>
                    </Switch>
                </BrowserRouter>
                <DateTime/>
                <WeatherInfo/>
            </div>
            <div style={{height: 293}}>
                <BrowserRouter>
                    <Switch>
                        <Route path="/kr">
                            <EmissionInfo_u_kr/>
                            <GraphInfoContainer_u_kr/>
                        </Route>
                    </Switch>
                </BrowserRouter>

            </div>
        </div>
    );
}

export default App;
